html,
body {
    height: 100%;
    margin: 0;
}

#app {
    height: 100%;
}

.el-header,
.el-footer {
    background-color: #B3C0D1;
    color: #333;
    text-align: center;
    line-height: 60px;
}

.el-aside {
    height: 100%;
    background-color: #D3DCE6;
    color: #333;
    text-align: center;
    padding: 10px 0
    /* line-height: 200px; */
}

.el-main {
    background-color: #E9EEF3;
    color: #333;
    text-align: center;
    line-height: 160px;
    height: 100%;
    padding: 0;
}

.el-container {
    padding-bottom: 0px;
    height: 100%;
}

.el-container:nth-child(5) .el-aside,
.el-container:nth-child(6) .el-aside {
    line-height: 260px;
}

.el-container:nth-child(7) .el-aside {
    line-height: 320px;
}

.el-header .el-input {
    margin-left: 10px;
}

.el-header .el-checkbox {
    margin-left: 10px;
}

.el-header {
